script: |
  super -f text -I q5892.spq | sort > q5892.out

inputs:
  - name: q5892.spq
    data: |
      SELECT DISTINCT - + col1 + - col2 + ( - + 67 ) + + 52 - col1 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT - 69 + col1 NOT BETWEEN 38 * 64 AND + col2;
  - name: tab0

outputs:
  - name: q5892.out
    data: |
